(function() {
    function getPRsPage(page) {
        const url = "https://api.github.com/repos/rms-open-letter/rms-open-letter.github.io/pulls?" + 
            "state=all&page=" + page.toString() + "&per_page=100";
        console.log(url);
        const headers = new Headers();
        headers.append("Accept", "application/vnd.github.v3+json");
        const request = new Request(url, {
            "method": "GET",
            "headers": headers,
        });
        return fetch(request)
            .then((response) => {
                if (response.status != 200) {
                    throw "Got status code " + response.status.toString();
                }
                return response.json();
            });
    }

    function getPRS(requestTimeout) {
        function getNextPage(successCallback) {
            page += 1;
            getPRsPage(page)
                .then((data) => {
                    for(let i = 0; i<data.length; i++) {
                        prs.push(data[i]);
                    }
                    if (data.length == 0) {
                        successCallback(prs);
                    } else {
                        setTimeout(() => {getNextPage(successCallback);}, requestTimeout);
                    }
                });
        }

        let prs = [];
        let page = 0;

        return new Promise((resolve, reject) => {
            getNextPage(resolve);
        });
    }

    function downloadRmsPullRequestsByUsers(requestTimeout) {
        return getPRS(requestTimeout)
            .then((pullRequests) => {
                let pullRequestsByUser = {}
                for (let i=0; i<pullRequests.length; i++) {
                    let request = pullRequests[i];
                    let user = request["user"]["login"];
                    let url = request["html_url"];
                    let title = request["title"];
                    if (pullRequestsByUser[user] === undefined) {
                        pullRequestsByUser[user] = [];
                    }
                    pullRequestsByUser[user].push({
                        "url": url,
                        "title": title,
                    });
                }
                return pullRequestsByUser;
            });
    }

    window.downloadRmsPullRequestsByUsers = downloadRmsPullRequestsByUsers;
})();
(function() {
    const updateTimeout = 24 * 3600;
    const storageItem = "rms-open-letter-prs";

    function now() {
        return Date.now() / 1000;
    }

    function addPRs(data, prs) {
        let users = Object.keys(prs);
        for(let i=0; i<users.length; i++) {
            let user = users[i];
            let userPrs = prs[user];
            if (data[user] === undefined) {
                data[user] = [];
            }
            for (let j=0; j<userPrs.length; j++) {
                data[user].push(userPrs[j]);
            }
        }
        return data;
    }

    function getRmsPullRequestsByUsers(readyCallback, updateCallback, hardcodedPRs) {
        let knownPRSText = localStorage.getItem(storageItem);
        if (!knownPRSText) {
            knownPRSText = JSON.stringify({
                "data": {},
                "time": now() - 24 * 3600 - 100
            });
        }
        let knownPRs = JSON.parse(knownPRSText);
        knownPRs.data = addPRs(knownPRs.data, hardcodedPRs);

        if (knownPRs.time < (now() - updateTimeout)) {
            const requestPerHour = 1000;
            const timeout = Math.ceil(3600 / requestPerHour);
            updateCallback();
            downloadRmsPullRequestsByUsers(timeout)
                .then(function(pullRequestsByUser) {
                    knownPRs.data = addPRs(knownPRs.data, pullRequestsByUser);
                    knownPRs.time = now();
                    localStorage.setItem(storageItem, JSON.stringify(knownPRs));
                    readyCallback(knownPRs.data);
                });
        }
        readyCallback(knownPRs.data);
    }

    window.getRmsPullRequestsByUsers = getRmsPullRequestsByUsers;
})();
(function() {
    function removeIndicatorIfExist() {
        let indicator = document.querySelectorAll("#rms-open-letter-signer-button");
        if (indicator.length > 0) {
            indicator[0].parentNode.removeChild(indicator[0]);
        }
    }

    function addSignerIndicator(username, requests) {
        removeIndicatorIfExist();

        let actions = document.querySelector(".pagehead-actions");
        
        let signerButtonContainer = document.createElement("li");
        let signerButton = document.createElement("a");
        let searchLink = "https://github.com/rms-open-letter/rms-open-letter.github.io/pulls?q=is%3Apr+author%3A" + username;

        signerButton.setAttribute("href", searchLink);
        signerButton.setAttribute("class", "btn btn-sm btn-danger");
        signerButton.setAttribute("id", "rms-open-letter-signer-button");
        signerButton.innerText = "Possible signer of RMS open letter";
        signerButtonContainer.appendChild(signerButton);

        let hintText = requests.map( (request) => { return request.title; } ).join("; ");
        signerButton.setAttribute("title", hintText);

        actions.appendChild(signerButtonContainer);

        return signerButton;
    }

    function addIndicatorIfHaveTo(username) {
        getRmsPullRequestsByUsers(
            (data) => {
                if ((data[username] !== undefined) && (data[username].length > 0)) {
                    addSignerIndicator(username, data[username]);
                }
            }, 
            () => {}, 
            window.hardcodedPRs
        );
    }

    function onload() {
        if (window.location.hostname.toLowerCase().endsWith("github.com")) {
            const username = window.location.pathname.split("/")[1];
            addIndicatorIfHaveTo(username);
        }
    }

    if (document.readyState != "complete") {
        window.addEventListener('load', onload);
    } else {
        onload();
    }
})();